import {useState} from 'react'

const Header = () => {
    const [isOpen, setIsOpen] = useState(false);
  return (
    <div>
         <nav className="bg-white shadow-md fixed w-full z-50">
      <div className="max-w-7xl mx-auto px-6 lg:px-12">
        <div className="flex justify-between items-center py-4">
          {/* Logo */}
          <a href="/" className="flex items-center text-xl font-bold text-gray-900">
            <img src="/logo.png" alt="Logo" className="h-8 w-8 mr-2" />
            ProTasks Solution
          </a>

          {/* Desktop Menu */}
          <div className="hidden md:flex space-x-8">
            <a href="#" className="text-gray-700 hover:text-blue-500 transition">Home</a>
            <a href="#" className="text-gray-700 hover:text-blue-500 transition">Our Services</a>
            <a href="#" className="text-gray-700 hover:text-blue-500 transition">About Us</a>
            <a href="#" className="text-gray-700 hover:text-blue-500 transition">Contact Us</a>
          </div>

          {/* Mobile Menu Button */}
          <button 
            onClick={() => setIsOpen(!isOpen)} 
            className="md:hidden text-gray-700 focus:outline-none"
          >
            {isOpen ? "✖" : "☰"}
          </button>
        </div>
      </div>

      {/* Mobile Menu */}
      {isOpen && (
        <div className="md:hidden bg-white border-t">
          <a href="#" className="block px-6 py-3 text-gray-700 hover:bg-gray-100">Home</a>
          <a href="#" className="block px-6 py-3 text-gray-700 hover:bg-gray-100">Our Services</a>
          <a href="#" className="block px-6 py-3 text-gray-700 hover:bg-gray-100">About Us</a>
          <a href="#" className="block px-6 py-3 text-gray-700 hover:bg-gray-100">Contact Us</a>
        </div>
      )}
    </nav>
    </div>
  )
}

export default Header
